import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import App from '../App';
import Film from './Film';

const Router = () => (
    <Switch>
        <BrowserRouter>
            <Route path="/" component={App}></Route>
            <Route path="/film" component={Film}></Route>
        </BrowserRouter>
    </Switch>
);

export default Router;
